// src/App.js - Updated with Internship Routes
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Context Providers
import { AuthProvider } from './context/AuthContext';

// Components
import Layout from './components/common/Layout';
import ProtectedRoute from './components/auth/ProtectedRoute';
import AuthGuard from './components/auth/AuthGuard';

// Auth Pages
import Login from './components/auth/Login';
import Signup from './components/auth/Signup';
import ForgotPassword from './components/auth/ForgotPassword';
import ResetPassword from './components/auth/ResetPassword';
import ChangePassword from './components/auth/ChangePassword';

// Main Pages
import Dashboard from './components/dashboard/Dashboard';
import DomainManagement from './components/domains/DomainManagement';
import SubDomainManagement from './components/domains/SubDomainManagement';
import ProjectManagement from './components/projects/ProjectManagement';
import LeadManagement from './components/leads/LeadManagement';

// New Internship Pages
import BranchManagement from './components/internships/BranchManagement';
import InternshipManagement from './components/internships/InternshipManagement';
import InternshipDomainManagement from './components/internships/InternshipDomainManagement';
import InternshipLeadManagement from './components/internships/InternshipLeadManagement';
import RatingManagement from './components/internships/RatingManagement';

// Utility Pages
import ComingSoon from './components/common/ComingSoon';

// Styles
import './styles/global.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            {/* Auth Routes - Public */}
            <Route path="/login" element={
              <AuthGuard>
                <Login />
              </AuthGuard>
            } />
            <Route path="/signup" element={
              <AuthGuard>
                <Signup />
              </AuthGuard>
            } />
            <Route path="/forgot-password" element={
              <AuthGuard>
                <ForgotPassword />
              </AuthGuard>
            } />
            <Route path="/reset-password" element={
              <AuthGuard>
                <ResetPassword />
              </AuthGuard>
            } />

            {/* Protected Routes - Require authentication */}
            <Route path="/" element={
              <ProtectedRoute>
                <Layout />
              </ProtectedRoute>
            }>
              {/* Redirect root to dashboard */}
              <Route index element={<Navigate to="/dashboard" replace />} />

              {/* Main Admin Routes */}
              <Route path="dashboard" element={<Dashboard />} />

              {/* Phase 1: Projects System */}
              <Route path="domains" element={<DomainManagement />} />
              <Route path="domains/:domainId/subdomains" element={<SubDomainManagement />} />
              <Route path="projects" element={<ProjectManagement />} />
              <Route path="leads" element={<LeadManagement />} />

              {/* Phase 2: Internships System */}
              <Route path="branches" element={<BranchManagement />} />
              <Route path="branches/:branchId/domains" element={<InternshipDomainManagement />} />
              <Route path="internships" element={<InternshipManagement />} />
              <Route path="internship-leads" element={<InternshipLeadManagement />} />
              <Route path="ratings" element={<RatingManagement />} />

              {/* Account Management */}
              <Route path="change-password" element={<ChangePassword />} />

              {/* Settings - Coming Soon */}
              <Route path="settings" element={<ComingSoon title="Settings" />} />

              {/* Catch all - redirect to dashboard */}
              <Route path="*" element={<Navigate to="/dashboard" replace />} />
            </Route>
          </Routes>

          {/* Toast Notifications */}
          <ToastContainer
            position="top-right"
            autoClose={5000}
            hideProgressBar={false}
            newestOnTop={false}
            closeOnClick
            rtl={false}
            pauseOnFocusLoss
            draggable
            pauseOnHover
            theme="light"
          />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;


